-- Sections will put me at 0x42cb. Which is close to the limit, could be slightly optimized.
NEXT_ID=255
DASH_ID=254
END_ID=253 -- if there is no gen 1 or event, just finish

function init() -- entry point for this compile script
  -- Initialize datastructures.
  local movedict = {} -- for each pokemon, t/f if they have a move
  local movearr  = {} -- for each pokemon, array/order of moves
  for i=0,251 do
    movedict[i] = {}
    movearr[i] = {}
  end

  -- Function for adding a move.
  local addmove = function(pkmnid, moveid)
    if not movedict[pkmnid][moveid] then
      movedict[pkmnid][moveid] = true
      add(movearr[pkmnid], moveid)
    end
  end

  -- Function for removing a move. Used to deduplicate previous evolutions.
  local delmove = function(pkmnid, moveid)
    if movedict[pkmnid][moveid] then
      movedict[pkmnid][moveid] = nil
      del(movearr[pkmnid], moveid)
    end
  end

  -- Function for adding learn things. Ensures a sorted order from strongest to weakest move.
  local learnfunc = function(data)
    data = datastr_to_arr(data)
    for arr in all(data) do
      local pkmnid = arr[1]
      local lvl_move_pairs = {}
      for i=2,#arr do
        local pair = split(arr[i], ":")
        add(lvl_move_pairs, pair)
      end

      sort(lvl_move_pairs, function(a,b) -- sort by level descending, if same, sort by moveid ascending
        return a[1] > b[1] or a[1] == b[1] and a[2] < b[2]
      end)

      for i=1,#lvl_move_pairs do
        addmove(pkmnid, lvl_move_pairs[i][2])
      end
    end
  end

  -- Function for just adding general moves. Moves are sorted from lowest to highest.
  local movesfunc = function(data)
    data = datastr_to_arr(data)
    for arr in all(data) do
      local pkmnid = arr[1]
      local moves = {}

      for i=2,#arr do
        add(moves, arr[i])
      end

      sort(moves, function(a,b)
        return a < b
      end)

      for i=1,#moves do
        addmove(pkmnid, moves[i])
      end
    end
  end

  -- Add function that separates the different types of moves.
  local addnext = function()
    for i=0,251 do
      add(movearr[i], NEXT_ID)
    end
  end

  local loglen = function(msg)
    local total = 0
    for i=0,251 do
      total += #movearr[i]
    end
    log("Total Len: "..tostr(total, 0x1).." | "..msg)
  end

  local dedup_evol = function()
    -- Populate the evolution dictionary.
    local evoldict = {}
    for arr in all(datastr_to_arr(pokemon_evol)) do
      local pkmnid = arr[1]
      local prevevol = arr[2]
      evoldict[pkmnid] = prevevol
    end

    -- Deduplicate all the moves for previous evolutions.
    for i=0,251 do
      if evoldict[i] then
        local pkmnid = evoldict[i]
        while pkmnid do
          for moveid in all(movearr[pkmnid]) do
            delmove(i, moveid)
          end
          pkmnid = evoldict[pkmnid]
        end
      end
    end
  end

  -- compresses the data a bit by removing move ranges.
  local replace_ranges = function()
    for i=0,251 do
      local oldarr = movearr[i]
      local newarr = {}

      local addrange = function(rbeg, rend)
        local  diff = rend-rbeg
        if     diff == 0 then add(newarr, rbeg)
        elseif diff == 1 then add(newarr, rbeg)                      add(newarr, rend)
        elseif diff >= 2 then add(newarr, rbeg) add(newarr, DASH_ID) add(newarr, rend)
        end
      end

      local rbeg, rend = -1, -2 -- rend starts less than rbeg both as impossible values so that the beginning part of the loop won't add anything.
      for x in all(movearr[i]) do
        if x == rend+1 then
          rend = x
        else
          addrange(rbeg, rend)
          rbeg, rend = x, x
        end
      end

      addrange(rbeg, rend)

      movearr[i] = newarr
    end
  end

  local addweird = function()
    movearr[P_SMEARGLE] = {M_SKETCH, M_SKETCH, M_SKETCH, M_SKETCH} -- smeargle is the only pokemon who can learn the same move in multiple slots.
    local all_moves = {}
    for i=0,251 do -- loop through all moves, and add all except a few to smeargle's moveset.
      if i != M_STRUGGLE and i != M_TM05 and i != M_SELFDESTRUCT and i != M_EXPLOSION and i != M_SKETCH then
        add(movearr[P_SMEARGLE], i)
      end
    end
  end

  -- Add all the moves.
  learnfunc(gen2_learn)    loglen("Added gen2 Lrnmvs") -- gen 2 learn (order matters)
  movesfunc(gen2_eggmoves) loglen("Added gen2 Eggmvs")
  -- Section
  movesfunc(gen2_tmhm)     loglen("Added gen2 TM/HMs") -- gen 2 teach (order doesn't matter)
  movesfunc(gen2_tutor)    loglen("Added gen2 Tutmvs")
  -- Section
  learnfunc(gen1_learn)    loglen("Added gen1 Lrnmvs") -- gen 1 only (order doesn't matter)
  movesfunc(gen1_tmhm)     loglen("Added gen1 TM/HMs")
  -- Section
  movesfunc(genx_events)   loglen("Added genx Events") -- event only (order doesn't matter)
  addweird()               loglen("Add gotchas")
  -- Section
  dedup_evol()             loglen("Dedup evolutions")
  replace_ranges()         loglen("Replace ranges")

  for i=0,251 do
    for x in all(movearr[i]) do
      offsetpoke(x)
    end
    -- printh(tostring(movearr[i]))
  end

  log("Wrote Pokemon Movesets")
end

